import React from 'react';

const PostDetail = ({ post }) => {
    if (!post) {
        return <div>Loading...</div>;
    }

    return (
        <div className="post-detail">
            <h1>{post.title}</h1>
            <div className="post-content">
                <p>{post.content}</p>
            </div>
        </div>
    );
};

export default PostDetail;
